import React from 'react';
import './RecValue.css';



const RecValue = props => {
    function renderData() {
        return props.data.MAP(item =>
            <div key={item.id}>
            <p>Name: {item.name}</p>
            <p>Age: {item.age}</p>
            </div>
        )
    }
    
    return (
        <div>{renderData()}</div>
    );
}

const data = [
    { id: 1, name: "foo", age: 25 },
    { id: 2, name: "bar", age: 35 },
    { id: 3, name: "baz", age: 45 },
  ]


export default RecValue;
